  [],\n\t\"revision_timestamp\": \"2015-05-07T06:04:50.918569\",\n\t\"name\": \"a-cryogenic-flow-sensor-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Advanced Technologies Group, Inc. proposes
  the development of a Cryogenic Flow Sensor (CFS)  for determining mass flow of cryogens
  in spacecraft propellant management. Current point sensor technology is incapable
  of determining high pressure, high flow rate cryogenic fluid quality and mass flow
  rate, and has proven to be inaccurate in attempting to rapidly measure cryogen depletion.
  \ If there is an abrupt change in fluid quality, turbo-machinery can over-speed
  causing catastrophic failure.  The CFS will provide a means to avoid these failures
  as well as providing fluid quality data for a wide range of flow systems. Experimental
  hardware was able to detect the onset of two-phase flow and the presence of debris
  in the flow of water.  The innovation clearly shows that it can discern between
  entrained gas bubbles and unwanted debris.  The sensor has the potential to determine
  size and quantity of the contaminant.  In addition, a non-intrusive method for determining
  the Mass-Flow?Rate of the fluid propellant has been designed, and is the focus of
  this phase I effort.  A cryogenic sensor with these capabilities is very desirable
  to the cryogenic fluids management community, as well as other fluid management
  systems,  and has many commercial applications.\",\n\t\"license_title\": \"U.S.
